import './App.css';
import Login from './Login';
import Register from './Register';
import Layout from './pages/Layout';
function App() {
  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Layout/>}>
        <Route path='/' element={<Home/>} />
        <Route path='/' element ={<Login />}/>
        <Route path='/register' element ={<Register />}/>
      </Route>

    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
